export default function Latestproduct(props) {
    const items = props.latestproduct;
    return (
    <div className="recent-products-container">
        <div className="recent-product">
            <div>
                <h5>최근 본 거</h5>
            </div>
            <div>
            {items.map((item, index) => (
                        <div key={index}>
                            <div>{item.title}</div>
                            <div>{item.content}</div>
                            <div>{item.price}</div>
                        </div>
                    ))
            }    
            </div>
        </div>
    </div>
    )
}
